import React from 'react';
import './MainPageStyle.css';
import img from '../Assets/logo.png';
import { MdPerson, MdInsertChart, MdSearch, MdAccessibility } from 'react-icons/md';
import { BsTools } from 'react-icons/bs';
import { VscPerson } from 'react-icons/vsc';

function MainPage(props){
    
    return(
        <div id="container">

            <header className="header">
                <div>{/* <img src={img} height="60px" /> */}</div>

                <div className="containerSearch">
                    <input type="text" />
                    <MdSearch className="searchIcon"/>
                </div>

                <div><MdPerson className="userIcon"/></div>
            </header>

            <body className="body">
                <div className="containerOptions">
                    <div className="option">
                        <VscPerson/>
                        <p className="p">Clientes</p>
                    </div>
                    <div className="option">
                        <BsTools className="toolIcon"/>
                        <p className="p">Servicos</p>
                    </div>
                    <div className="option">
                        <MdInsertChart/>
                        <p className="p">Financeiro</p>
                    </div>
                </div>
            </body>

          
        </div>
    );
}

export default MainPage;
